import MethodPage from "../MethodPage/MethodPage";
import classes from "./SetPage.module.css";

interface SetPage{
    pc: number;
}

const SetPage = ({pc}: SetPage) => {
    document.title = `${pc}${["","st","nd","rd","th","th","th","th"][pc]} PC`;

    const seconds = [];
    for(let i = 0; i<7;i++){
        for(let j = i+1; j<7; j++){
            for (let k = j+1; k<7;k++){
                for(let l = k+1; l<7;l++){
                    seconds.push("TIJLOSZ"[i]+"TIJLOSZ"[j]+"TIJLOSZ"[k]+"TIJLOSZ"[l]);
                    
                }
            }
        }
    }
    

    return <div className="hi">
        {seconds.map(second =><MethodPage></MethodPage>
        )}
    </div>;
}

export default SetPage;
